import React, {Component} from "react"

export default class Conferences extends Component{
    constructor(props){
        super(props);
        this.state={conference:[]}
    }
    componentDidMount() {
        // let a = "Tushar Bansal";
        //let name = `'${a}'`;
        base("Imported table")
          .select({
            view: "Grid view",
            //filterByFormula: "SEARCH(" + name + ",{Participant Name})",
            fields: ["Date", "Participant Name"],
          })
          .eachPage((records, fetchNextPage) => {
            let arr = records.map((record) => record.fields["Participant Name"]);
            let a = [...new Set(arr)];
            this.setState({ conference: a });
            fetchNextPage();
          });
